import React from 'react';



export const About = () => {
  return (
    <div className="text-center">
      <div className="mani">
        <h2>A. P. J. Abdul Kalam</h2>
        <figure class="figure">
          <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F6%2F6e%2FA._P._J._Abdul_Kalam.jpg%2F800px-A._P._J._Abdul_Kalam.jpg&tbnid=nd12FThekmFA9M&vet=12ahUKEwjb5vnT__b_AhV9u2MGHfXsDu8QMygAegUIARDeAQ..i&imgrefurl=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FA._P._J._Abdul_Kalam&docid=zASdkWHhQV1wKM&w=800&h=946&itg=1&q=abdul%20kalam&ved=2ahUKEwjb5vnT__b_AhV9u2MGHfXsDu8QMygAegUIARDeAQ" class="figure-img img-fluid rounded"
            alt="https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F6%2F6e%2FA._P._J._Abdul_Kalam.jpg%2F800px-A._P._J._Abdul_Kalam.jpg&tbnid=nd12FThekmFA9M&vet=12ahUKEwjb5vnT__b_AhV9u2MGHfXsDu8QMygAegUIARDeAQ..i&imgrefurl=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FA._P._J._Abdul_Kalam&docid=zASdkWHhQV1wKM&w=800&h=946&itg=1&q=abdul%20kalam&ved=2ahUKEwjb5vnT__b_AhV9u2MGHfXsDu8QMygAegUIARDeAQ" />
          <figcaption class="figure-caption">A caption for the above image.</figcaption>
        </figure>

      </div>
    </div>

  )
};

export default About
